!async function(){const o=JSON.parse(localStorage["ember_simple_auth-session-5"]).authenticated.session.auth_token,e=`https://zyserver.zybooks.com/v1${location.pathname}?auth_token=${o}`,n=await fetch(e).then((o=>o.json()));window.res=n,console.clear(),console.log("ez$");const s=n?.section?.content_resources;if(!Array.isArray(s))return console.log("Something went wrong. Here's the response:"),void console.log(n);const c=s.filter((({activity_type:o})=>"participation"===o));for(const o of c){const e=`div[content_resource_id="${o.id}"]`;console.group(e);const n=document.querySelector(e);if(n){console.info("OK ELEMENT");const e=n.children[1]?.children[1];if(e){const n=[...e.children].map((o=>o.children[0]));console.groupCollapsed("OK SHORT ANSWER PAYLOAD");for(let e=0;e<n.length;++e){const s=n[e].children[0]?.children?.[1];if(s){console.info("OK TITLE "+e);const n=o.payload.questions[e];n.answers?(console.info("OK SHORT ANSWER "+e),s.innerHTML+=` <i>(${n.answers.join(", ")})</i>`):n.choices?(console.info("OK MULTI CHOICE "+e),s.innerHTML+=` <i>(#${n.choices.findIndex((({correct:o})=>o))+1})</i>`):console.error("BAD QUESTION "+e)}else console.error("BAD TITLE "+e)}console.groupEnd()}else console.error("BAD SHORT ANSWER PAYLOAD")}else console.error("BAD ELEMENT");console.groupEnd()}}()
